import React, {Component, } from 'react'


class Seeding extends Component {
  state = { 
    seed: 'personal',
   } 

  updateSeed = (category) => {
    this.setState({seed: category});
    console.log('state: ', this.state.seed)
  }

  render() { 
    return (
      <div className="seeding-container">
        <select onChange={this.updateSeed(this.value)}>
          <option value="artist">Artist</option>
          <option value="songs">Song</option>
          <option value="genre">Genre</option>
          <option value="personal">Your Top Songs</option>
        </select>
        {this.state.seed}
      </div>
    );
  }
}
 
export default Seeding;
